column2:
@JoeNichols having a Woodstock moment in the infield of @BMSupdates 
We've lost the track, rain pouring down, and Joe's singing about a cold one.
#ItsBristolBaby

@Devin_Heroux @cbcsports "pouring rain"? What's that? (If only that were the case in B.C. r n #BCWildfires) 
Tell 'em to throw on rain ponchos and get on with the game! 
btw- GO Surrey B.C. \0/ !!

